    const res = await response.json()
    return res.searchId
}

const fetchData = () => {
  return fetchSearchId()
    .then(indexId => {
    fetch(`https://aviasales-test-api.kata.academy/tickets?searchId=${indexId}`)
      .then(data => data.json())
      .then(tickets => {
        console.log(tickets)
        return tickets;
      })
  })
}

